const Child = ({ user }) => {
    if (!user) {
        return <p>No user data found.</p>;
    }

    return (
        <div>
            <h1>User Details</h1>
            <p>Name: {user.firstName} {user.lastName}</p>
            <p>Gender: {user.gender}</p>
            <p>Age: {user.age}</p>
        </div>
    );
};

export default Child;
